import Link from 'next/link';

const Header = () => (
  <nav>
    <p>Loca'part</p>
    <div>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
    </div>
  </nav>
);

export default Header;
